// import React, { useEffect, useState } from 'react';
import {
  Box,
  TextField,
  MenuItem,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  IconButton,
  Button,
  FormControl,
  InputLabel,
  Select,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
} from '@mui/material';
import { styled } from '@mui/material/styles';
import { Formik, Form, Field } from 'formik';
import CloseIcon from '@mui/icons-material/Close';
import DeleteIcon from '@mui/icons-material/Delete';
import EditIcon from '@mui/icons-material/Edit';
import axios from 'axios';
import InteviewPortal from './InteviewPortal';

// Styled Components
const BootstrapDialog = styled(Dialog)(({ theme }) => ({
  '& .MuiDialogContent-root': {
    padding: theme.spacing(2),
  },
  '& .MuiDialogActions-root': {
    padding: theme.spacing(1),
  },
}));

const StyledTableCell = styled(TableCell)(({ theme }) => ({
  [`&.${tableCellClasses.head}`]: {
    backgroundColor: '#1976d2',
    color: theme.palette.common.white,
  },
  [`&.${tableCellClasses.body}`]: {
    fontSize: 14,
  },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  '&:nth-of-type(odd)': {
    backgroundColor: theme.palette.action.hover,
  },
  '&:last-child td, &:last-child th': {
    border: 0,
  },
}));

const SubCategory = () => {
  const [open, setOpen] = useState(false);
  const [categories, setCategories] = useState([]);
  const [subCategories, setSubCategories] = useState([]);
  const [editId, setEditId] = useState(null);
  const [initialValues, setInitialValues] = useState({
    subCategoryname: '',
    categoryID: '',
  });

  // Fetch Subcategories
  const fetchSubCategories = () => {
    axios
      .get('https://interviewback-ucb4.onrender.com/subcategory/', {
        headers: {
          Authorization: 'your_token_here',
        },
      })
      .then((res) => setSubCategories(res.data.data))
      .catch((error) => console.log(error));
  };

  // Fetch Categories
  const fetchCategories = () => {
    axios
      .get('https://interviewback-ucb4.onrender.com/category/', {
        headers: {
          Authorization: 'your_token_here',
        },
      })
      .then((res) => setCategories(res.data.data))
      .catch((error) => console.log(error));
  };

  useEffect(() => {
    fetchSubCategories();
    fetchCategories();
  }, []);

  // Open Modal for Add/Edit
  const handleClickOpen = () => {
    setEditId(null);
    setInitialValues({ subCategoryname: '', categoryID: '' });
    setOpen(true);
  };

  // Open Modal for Edit
  const handleEdit = (id, row) => {
    setEditId(id);
    setInitialValues({
      subCategoryname: row.subCategoryname,
      categoryID: row.categoryID?._id || '',
    });
    setOpen(true);
  };

  // Handle Form Submit
  const handleSubmit = (values, { resetForm }) => {
    const request = editId
      ? axios.patch(`https://interviewback-ucb4.onrender.com/subcategory/${editId}`, values, {
          headers: { Authorization: 'your_token_here' },
        })
      : axios.post('https://interviewback-ucb4.onrender.com/subcategory/create', values, {
          headers: { Authorization: 'your_token_here' },
        });

    request
      .then(() => {
        fetchSubCategories();
        resetForm();
        setEditId(null);
        setOpen(false);
      })
      .catch((error) => console.log(error));
  };

  // Delete Category
  const handleDelete = (id) => {
    axios
      .delete(`https://interviewback-ucb4.onrender.com/subcategory/${id}`, {
        headers: { Authorization: 'your_token_here' },
      })
      .then(() => fetchSubCategories())
      .catch((error) => console.log(error));
  };

  return (
    <InteviewPortal>
      <Box display="flex" flexWrap="wrap" justifyContent="space-between">
        <TextField select label="Search Category" sx={{ width: '80%' }}>
          {categories.map((category) => (
            <MenuItem key={category._id} value={category._id}>
              {category.categoryName}
            </MenuItem>
          ))}
        </TextField>
        <Button variant="contained" onClick={handleClickOpen}>
          ADD SUB-CATEGORY
        </Button>
      </Box>

      {/* Modal */}
      <BootstrapDialog onClose={() => setOpen(false)} open={open}>
        <DialogTitle>
          {editId ? 'Edit Subcategory' : 'Add Subcategory'}
          <IconButton
            onClick={() => setOpen(false)}
            sx={{ position: 'absolute', right: 8, top: 8 }}
          >
            <CloseIcon />
          </IconButton>
        </DialogTitle>
        <Formik enableReinitialize initialValues={initialValues} onSubmit={handleSubmit}>
          {({ setFieldValue, values }) => (
            <Form>
              <DialogContent dividers>
                <Field as={TextField} name="subCategoryname" label="Subcategory Name" fullWidth />

                <FormControl fullWidth sx={{ mt: 2 }}>
                  <InputLabel>Category</InputLabel>
                  <Select
                    name="categoryID"
                    value={values.categoryID}
                    onChange={(e) => setFieldValue('categoryID', e.target.value)}
                  >
                    {categories.map((category) => (
                      <MenuItem key={category._id} value={category._id}>
                        {category.categoryName}
                      </MenuItem>
                    ))}
                  </Select>
                </FormControl>
              </DialogContent>
              <DialogActions>
                <Button type="submit" variant="contained">
                  Submit
                </Button>
              </DialogActions>
            </Form>
          )}
        </Formik>
      </BootstrapDialog>

      {/* Table */}
      <TableContainer component={Paper} sx={{ mt: 2 }}>
        <Table>
          <TableHead>
            <TableRow>
              <StyledTableCell>No.</StyledTableCell>
              <StyledTableCell>Sub-Category Name</StyledTableCell>
              <StyledTableCell>Category Name</StyledTableCell>
              <StyledTableCell align="right">Actions</StyledTableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {subCategories.map((row, index) => (
              <StyledTableRow key={row._id}>
                <StyledTableCell>{index + 1}</StyledTableCell>
                <StyledTableCell>{row.subCategoryname}</StyledTableCell>
                <StyledTableCell>{row.categoryID?.categoryName || 'N/A'}</StyledTableCell>
                <StyledTableCell align="right">
                  <IconButton onClick={() => handleEdit(row._id, row)}>
                    <EditIcon />
                  </IconButton>
                  <IconButton onClick={() => handleDelete(row._id)} color="error">
                    <DeleteIcon />
                  </IconButton>
                </StyledTableCell>
              </StyledTableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </InteviewPortal>
  );
};

export default SubCategory;
